///INSERTION
void insertion_sort(int vet[],int tam ){
    clock_t tempo;
    tempo=clock();
    for (int i = 1; i < tam; i++){
		int aux = vet[i];
		int j = i - 1;

		while ((j >= 0) && (vet[j] > aux)){
			vet[j + 1] = vet[j];
			j--;
		}

		vet[j + 1] = aux;
	}
	tempo=clock()-tempo; ///se eu tirar o /CLOCKS_PER_SEC o retorno da um valor diferente de 0 (acredito que esteja pegando apenas a parte inteira)
	cout<<"Tempo de ordenacao com Insertion Sort: "<<(float)tempo/CLOCKS_PER_SEC<<" segundos"<<endl;
                /*cout<<"Vetor ordenado: "<<endl;
                for(int i=0;i<tam;i++){
                    cout<<vet[i]<<",";
                }*/
}


///SELECTION
void selection_sort(int vet2[], int tam2) {
    clock_t tempo;
    tempo=clock();
    for (int i = 0; i < tam2; i++){
        int indiceMenor = i;
        for (int j = i+1; j < tam2; j++){
            if (vet2[j] < vet2[indiceMenor]){
                indiceMenor = j;
            }
        }
        int aux = vet2[i];
        vet2[i] = vet2[indiceMenor];
        vet2[indiceMenor] = aux;
    }
    tempo=clock()-tempo;
    cout<<"Tempo de ordenacao utilizando Selection Sort: "<<(float)tempo/CLOCKS_PER_SEC<<" segundos"<<endl;
}

///BUBBLE
void Bubble_Sort(int vetor[], int tam3){
	int aux,i,j;
	clock_t tempo;
    tempo=clock();
	for(j=tam3-1; j>=1; j--){
		for(i=0; i<j; i++){
			if(vetor[i]>vetor[i+1]){
				aux=vetor[i];
                    vetor[i]=vetor[i+1];
                    vetor[i+1]=aux;
            }
        }
    }
    tempo=clock()-tempo;
    cout<<"Tempo de ordenacao utilizando Bubble Sort: "<<(float)tempo/CLOCKS_PER_SEC<<" segundos"<<endl;
}


///ALGORITMO DE ORDENAÇÃO MAIS COMPLEXO

///QUICK SORT
void quicksort(int vetor[], int inicio, int fim){
	int i, j, pivo, aux;
	i = inicio;
	j = fim-1;
	pivo = vetor[(inicio+fim)/2];
	while(i <= j){
		while(vetor[i] < pivo && i < fim){
			i++;
		}
		while(vetor[j] > pivo && j > inicio){
			j--;
		}
		if(i <= j){
			aux = vetor[i];
			vetor[i] = vetor[j];
			vetor[j] = aux;
			i++;
			j--;
		}
    }
	if(j > inicio)
        //cout
		quicksort(vetor, inicio, j+1);
	if(i < fim){
		//cout
		quicksort(vetor, i, fim);
	}
}

